import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../../assets';
export default function Header() {
  return (
    <header className="container">
      <Link>
        <img className="logo" src="{logo}" alt="logo do projeto" />
      </Link>
    </header>
  );
}
